import React from "react";

export default function user_profile_banner() {
  return (
    <div className="user_profile_banner">
      <div className="container">
        <div className="row">
          <div className="col-md-12">
            <h1 className="page-title">Current User profile banner</h1>
          </div>
        </div>
      </div>
    </div>
  );
}
